const initialState = {
  products: {},
};

const productsReducer = (state = initialState, action) => {
  switch (action.type) {
    case "FETCH_PRODUCTS":
      const newProducts = state.products;
      return {
        ...state,
        products: { ...action.products },
      };
    default:
      return { ...state };
  }
};
export default productsReducer;
